import React, { createContext } from 'react'
import App1 from './App1';

export const Context = () => {

    const Myname=createContext();
    return (
        <>
            <Myname.Provider value={'Yash'}>
                <App1 />
            </Myname.Provider>
        </>
    )
}

export default Context;
